interface IconProps extends Omit<SvgProps, "viewBox"> {
    name: keyof typeof svgDefinitions;
    color?: string;
    size?: number;
}

export default function Icon({
    name,
    color = theme.colors.content,
    size = 24,
    style,
    ...props
}: IconProps) {
    const svgData = svgDefinitions[name];

    if (!svgData) {
        console.warn(`SVG "${name}" not found in definitions`);
        return null;
    }

    return (
        <View
            style={[
                {
                    width: size,
                    aspectRatio: svgData.viewBox.w / svgData.viewBox.h,
                },
                style,
            ]}
        >
            <Svg
                viewBox={`0 0 ${svgData.viewBox.w} ${svgData.viewBox.h}`}
                style={{ width: "100%", height: "100%" }}
                {...props}
            >
                <Path fill={color} d={svgData.path} />
            </Svg>
        </View>
    );
}

